import React from 'react'
import {View, StyleSheet, Text} from 'react-native'

 export default function Header({}){
    return(
        <View style={styles.container}>
            touch
        </View>
    )
}

 const styles = StyleSheet.create({
    container:{
        backgroundColor: "#b7b7b7",
    }
})
